import styles from './Navigation.module.css';

const Navigation = () => {
  return (
    <div className={styles.navigation}>
      <ul>
        <li>
          <Link href="/">
            <a >Index</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a >About</a>
          </Link>
        </li>
        <li>Services</li>
      </ul>
    </div>
  );
}

export default Navigation;
